script: |
  super -f text -I q2698.spq | sort > q2698.out

inputs:
  - name: q2698.spq
    data: |
      SELECT DISTINCT - col0 + + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 BETWEEN ( col2 ) AND 24 - 62;
  - name: tab2

outputs:
  - name: q2698.out
    data: |
      -17
      -23
      -24
